import React from 'react'
import Back from "../common/back/Back"
import { useTranslation } from 'react-i18next'
import "./price.css"
import Faq from "./Faq"
const Price = () => {
  const [t] = useTranslation("global");
  return (
    <>
      <Back title={t("footer.FAQs")} />
      <Faq />
    </>
  )
}

export default Price
